import React from "react";
import { Link } from "react-router-dom";
import { Grid, AppBar, Toolbar, Button, Typography } from "@material-ui/core";
import { makeStyles } from "@material-ui/core/styles";

const style = makeStyles(theme => ({
  root: { flexGrow: 1 },
  items: { flexGrow: 1 },
  leftitem: {
    marginLeft: theme.spacing(20),
    marginRight: theme.spacing(2),
    flexGrow: 1
  },
  login: {}
}));

function Navbar() {
  const classes = style();

  return (
    <Grid container spacing={2}>
      <Grid item md={12}>
        <AppBar className={classes.root} position="static">
          <Toolbar>
            <Typography variant="h6" className={classes.leftitem}>
              <Link to="/">HOME </Link>
            </Typography>

            <Typography variant="h6" className={classes.items}>
              <Link to="/workwithme"> WORK WITH ME </Link>
            </Typography>

            <Typography variant="h6" className={classes.items}>
              <Link to="/about"> ABOUT & CONTACT </Link>
            </Typography>

            <Button color="inherit" href="/login" className={classes.login}>
              Login
            </Button>
          </Toolbar>
        </AppBar>
      </Grid>
    </Grid>
  );
}

export default Navbar;
